import TitleHead from '@layoutStore/title-head';
import React from 'react';

const PageCheckOut = () => {
    return (
        <>
            <TitleHead></TitleHead>
            <NavBar>{<InputSearch></InputSearch>}</NavBar>
            <HeaderContact></HeaderContact>
            <Footer></Footer>
        </>
    );
};

export default PageCheckOut;
